import React from 'react';
import logo from './logo.svg';
import './App.css';
import logoyt from './img/logoyt.JPG';
// import fimh from './img/fimhelder.jpg';
import lupah from './img/lupah.JPG';
import mich from './img/mich.JPG';
import criarh from './img/criarh.JPG';
import appsdoyt from './img/appsdoyt.JPG';
import perfilh from './img/perfilh.JPG';
import notificah from './img/notificah.JPG';

// ----------------IMPORT DO MENU

import home from './img-menu/home.JPG';
import explorar from './img-menu/explorar.JPG';
import shorts from './img-menu/shorts.JPG';
import inscricoes from './img-menu/inscricoes.JPG';
import biblioteca from './img-menu/biblioteca.JPG';
import historico from './img-menu/historico.JPG';
import seusvideos from './img-menu/seusvideos.JPG';


// Obs: Se eu colocar legenda nas imagens para parecer o Youtube, 
// vou estragar a const titulo que foi proposta nos exercícios, 
// então só vou trocar as imagens e manter "Título do vídeo"

function App() {

  const titulo = "Título do vídeo"

  const pesquisar = () => {
    alert ("Pesquisar")
  }

  const mic = () => {
    alert ("Pesquisar com sua voz")
  }

  const criar = () => {
    alert ("Criar")
  }


  const app = () => {
    alert ("Aplicativos do Youtube")
  }

  const notifica = () => {
    alert ("Notificações")
  }

  const perfil = () => {
    alert ("Perfil")
  }

  const nada = () => {
    alert (" ")
  }

  function reproduzVideo() {
    alert("O vídeo está sendo reproduzido")
}

  return (
    <div>
      <div className="tela-inteira">
        <header>
            <img id='lyt' src= {logoyt}/>            
            <input type="text" placeholder="Busca" id="campoDeBusca" />
            <button id='lup' onClick={pesquisar}> <img id='iml' src={lupah}/> </button>
            <button className='botaozin'onMouseOver={mic}> <img src={mich}/> </button>
            <div className='fim'>
            <button className='botaozin' onMouseOver={criar} onNouseOut={nada}> <img src={criarh}/> </button>
            <button className='botaozin'onMouseOver={app} > <img src={appsdoyt}/> </button>
            <button className='botaozin' onMouseOver={notifica} > <img src={notificah}/> </button>
            <button className='botaozin' onMouseOver={perfil}> <img src={perfilh}/> </button>
            </div>
            {/* <img src= {fimh}/> */}

        </header>

        <main>
            <nav className="menu-vertical">

                    <img src={home}/><button className='botaomenu'>Início</button> <br/>
                    <img src={explorar}/><button className='botaomenu'>Explorar</button><br/>
                    <img src={shorts}/><button className='botaomenu'>Shorts</button> <br/>             
                    <img src={inscricoes}/><button className='botaomenu'>Inscrições</button><br/>
                    <img src={biblioteca}/><button className='botaomenu'>Biblioteca</button><br/>
                    <img src={historico}/><button className='botaomenu'>Histórico</button><br/>
                    <img src={seusvideos}/><button className='botaomenu'>Seus vídeos</button>

                <button id='mais'><u>mais</u></button>
            </nav>

            <section className="painel-de-videos">
                <div className="box-pagina-principal media1" onClick={reproduzVideo} >
                    <img src="data:image/jpeg;base64, " alt=""/>
                    <h4>{titulo}</h4>
                </div>
                <div className="box-pagina-principal media2" onClick={reproduzVideo} >
                    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTp2yDT7tl2sOs0OFyIOavA2Ifk_VmFjGGV2g&usqp=CAU " alt=""/>
                    <h4>{titulo}</h4>
                </div>
                <div className="box-pagina-principal media3" onClick={reproduzVideo} >
                    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRoM7QLlXZyJKn8uksBPnnmKU-7x9SD2QR5BQ&usqp=CAU " alt=""/>
                    <h4>{titulo}</h4>
                </div>
                <div className="box-pagina-principal media4" onClick={reproduzVideo} >
                    <img src="data:image/jpeg;base64, " alt=""/>
                    <h4>{titulo}</h4>
                </div>
                <div className="box-pagina-principal media5" onClick={reproduzVideo} >
                    <img src="data:image/jpeg;base64, " alt=""/>
                    <h4>{titulo}</h4>
                </div>
                <div className="box-pagina-principal media6" onClick={reproduzVideo} >
                    <img src="data:image/jpeg;base64, " alt=""/>
                    <h4>{titulo}</h4>
                </div>
                <div className="box-pagina-principal media7" onClick={reproduzVideo} >
                    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTHVWi80r7UYNyfNgJOXZ8jTDnmtJm0kTZpOQ&usqp=CAU " alt=""/>
                    <h4>{titulo}</h4>
                </div>
                <div className="box-pagina-principal media8" onClick={reproduzVideo} >
                    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSMv4qvDCHxRbPe_kJwnX5hPoNC6UWAC-Kt8w&usqp=CAU " alt=""/>
                    <h4>{titulo}</h4>
                </div>

            </section>
        </main>
{/* Esse footer não aparece no youtube, então vou comentar!
        <footer>
            <h4>Oi! Eu moro no footer!</h4>
        </footer> */}
    </div>
    </div>
  );
}

export default App;
